import React from 'react';
import s from './MyPosts.module.css'
import Post from './Post/Post';

const MyPosts = (props) => {

    return (
        <div>
            <div>
            <textarea></textarea>
                <div><input type='button' value='Создать новый пост'/></div>
                </div>
            {props.posts.map((el)=> {return <Post post={el.posts} id={el.id}/>})}
        </div>
    );
};

export default MyPosts;
